import * as s from './Sidebar_style'

const Sidebar = () => {
    const backgroundImage = 'https://images.unsplash.com/photo-1569982175971-d92b01cf8694?ixlib=rb-1.2.1&ixid=MXwxMjA3fDB8MHxleHBsb3JlLWZlZWR8M3x8fGVufDB8fHw%3D&w=1000&q=80'
    const sidebarData = [
       {name:'Home', to:'/', submenu:[],icon:'fa fa-home'},
       {name:'About', to:'/', submenu:[],icon:'fa fa-eject'},
       {name:'Category', to:'/', submenu:[],icon:'fa fa-user-secret'},
       {name:'contacs', to:'/', submenu:[],icon:'fa fa-building-o'}
    ]
    const handleSidebarMenu = sidebarData.map((item,index)=>{
          return(
             <s.MenuItem key={index++}>
    <s.Icon><i className={item.icon}></i></s.Icon>{item.name}
             </s.MenuItem>
          )
       })
    return ( 
        <s.Container backgroundImage={backgroundImage}>
           <s.Image src="https://w7.pngwing.com/pngs/247/564/png-transparent-computer-icons-user-profile-user-avatar-blue-heroes-electric-blue.png"/>
           <s.sidebarHeader>
              Dashboard
           </s.sidebarHeader>
           <s.menuContainer>
              {handleSidebarMenu}
           </s.menuContainer>
        </s.Container>
     );
}

export default Sidebar;
